const ThemesOptions = ({ themesOptions, themeSelected, handleThemeChange }) => {
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle py2'>
          <h6 className='fontStyle fsH3'>Themes Options:</h6>
        </div>

        <div className='buttons row '>
          {themesOptions.map((themesOption) => (
            <button
              type='button'
              key={themesOption.id}
              onClick={handleThemeChange}
              value={themesOption.themeValue}
              className='btn btnMD btnPrimary'>
              {themesOption.themeName}
            </button>
          ))}
        </div>

        <div className='buttons'>
          {themesOptions.map((themesOption) => (
            <button
              type='button'
              key={themesOption.id}
              onClick={handleThemeChange}
              value={themesOption.themeValue}
              className='btn btnMD btnPrimaryOutlined'>
              {themesOption.themeName}
            </button>
          ))}
        </div>

        {/* <div className='filters'>
          <select
            id='themes-options'
